import {
  FETCH_TRENDING_MOVIE,
  FETCH_POPULAR_MOVIE,
  FETCH_TOP_RATED_MOVIE,
  FETCH_UPCOMING_MOVIE,
} from "../constants/action";

const movie_reducer = (state, action) => {
  switch (action.type) {
    case FETCH_TRENDING_MOVIE:
      console(FETCH_TRENDING_MOVIE);
      break;
    default:
  }
  if (action.type === FETCH_POPULAR_MOVIE) {
    return {};
  }

  return state;
};

export default movie_reducer;
